            "content": "<script>\n  [\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"प्यार 💏 करना सिखा है….नफरतो 😡 का कोई ठौर नही, ❌\\n\\nबस तु 👈 ही तु है इस दिल ❤ मे….. दूसरा कोई 👆और नही. ❌\",\n        \"saved\": \"N\",\n        \"sid\": 1,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"कौन कहता है कि मुसाफिर ज़ख़्मी नहीं होते,\\nरास्ते गवाह है बस गवाही नहीं देते.\",\n        \"saved\": \"N\",\n        \"sid\": 2,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"क्या क्या रंग दिखाती है जिंदगी क्या खूब इक्तेफ़ाक होता है,\\n\\nप्यार में ऊम्र नही होती पर हर ऊम्र में प्यार होता है.\",\n        \"saved\": \"N\",\n        \"sid\": 3,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"मेरी मोहब्बत #की हद ना तय कर पाओगे तुम,\\nतुम्हें साँसों से भी ज्यादा मोहब्बत #करते है हम.\",\n        \"saved\": \"N\",\n        \"sid\": 4,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"ये दुनियाँ के तमाम चेहरे तुम्हें गुमराह कर देंगें, 😏\\n\\nतुम 👈 बस मेरे दिल ❤ में रहो, यहाँ 👆 कोई आता जाता नहीं. ❌\",\n        \"saved\": \"N\",\n        \"sid\": 5,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"वो लाख तुझे पूजती होगी। मगर तू खुश न हो ए खुदा,\\nवो पगली मन्दिर भी जाती है तो बस मेरी गली से गुजरने के लिए. \",\n        \"saved\": \"N\",\n        \"sid\": 6,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"उसके 👈 रूठने 😏 की अदायें भी, क्या गज़ब की है,\\nबात-बात पर ये कहना, सोंच लो.. फ़िर मैं बात नही ❌ करूंगी. 😘😚😜\