 पहले , और जीना है तेरे साथ मारने से पहले…😍😍😍\",\n        \"saved\": \"N\",\n        \"sid\": 107,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"एक धागे के प्रेम में,जैसे मोमबत्ती कतरा-कतरा जलती है,बस ऐसा ही प्यार… वो पगला मुझसे करता है… ☺️\",\n        \"saved\": \"N\",\n        \"sid\": 108,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"शिकायतों 😡 की पाई-पाई जोड़कर रखी थी मैंने, उसने गले लगाकर सारा हिसाब बिगाड़ दिया 😍😍😍\",\n        \"saved\": \"N\",\n        \"sid\": 109,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"तुम्हें कितनी मोहब्बत है… मालूम नहीं …. मुझे लोग आज भी तेरी क़सम दे कर मना लेते है 😊😊😊\",\n        \"saved\": \"N\",\n        \"sid\": 110,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"वो मौत भी बडी हसीन होगी जो तेरी बाहो👰 मे आनी होगी… वादा रहा तुझसे, पहले हम मर जायेंगे क्योंकि तेरे लिये जऩ्नत भी सजानी होगी 😍\",\n        \"saved\": \"N\",\n        \"sid\": 111,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"तेरे हुस्न को नकाब 😌 की जरुरत ही क्या है 😘 न जाने कौन रहता होगा होश 😌 में तुझे देखने के बाद 😘\",\n        \"saved\": \"N\",\n        \"sid\": 112,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"चाहता हूँ 👸 तुझे अपने ❤ दिल में 💏 छुपाना…क्योकि बहुत 😁 बुरा है ये 😭 ज़माना…\\n\",\n        \"saved\": \"N\",\n        \"sid\": 113,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"मेरे लफ्ज़ फ़ीके पड़ गए 