            "title": "Love Quotes -English",
            "content": "<script>\n[\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"If you were thinking about someone, while you were reading these status, you're definitely in Love my friend…\",\n        \"saved\": \"N\",\n        \"sid\": 1,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Can I borrow a kiss… I promise I’ll give it back.\",\n        \"saved\": \"N\",\n        \"sid\": 2,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I want to be in your arms, where you hold me tight and never let me go.\",\n        \"saved\": \"N\",\n        \"sid\": 3,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Loving you is like breathing – so effortless, so natural. And so essential to life.\",\n        \"saved\": \"N\",\n        \"sid\": 4,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Perfect love casts out all fear.\",\n        \"saved\": \"N\",\n        \"sid\": 5,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Love is like a Air ..We can’t see it but! we can feel it.\",\n        \"saved\": \"N\",\n        \"sid\": 6,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Loving you is more than just a dream comes true.\\nWhen I see my phone light up, I always hope that it’s a text message from you….\",\n        \"saved\": \"N\",\n        \"sid\": 7,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"True love is when he does little things for you before you ask\\n\",\n        \"saved\": \"N\",\n        \"sid\": 8,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Everyone says you fall in love only ones, but i fall daily with the same person.\",\n        \"saved\": \"N\",\n        \"sid\": 9,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"If a hug tell how much i love you, i would hold you in my arms forever\",\n        \"saved\": \"N\",\n        \"sid\": 10,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Love is like water in river.It keeps flowing ,though there are huge rocks which hinder its way.\",\n        \"saved\": \"N\",\n        \"sid\": 11,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"You can push them away, but people who really love you will always choose to stay\",\n        \"saved\": \"N\",\n        \"sid\": 12,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"If you live to be 100 years old, then i want to live 99 years so i won’t ever have to live without you.\",\n        \"saved\": \"N\",\n        \"sid\": 13,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I wish love had traffic lights…So that i’ll know weather I should GO for it,SLOW down or just STOP.\",\n        \"saved\": \"N\",\n        \"sid\": 14,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I fell in love with you, not because of your looks but for who you are.\",\n        \"saved\": \"N\",\n        \"sid\": 15,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Love is when you look into someones eye and see everything you ever need.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 16,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"True love doesn’t have happy ending …it has No ending.\",\n        \"saved\": \"N\",\n        \"sid\": 17,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"When i text you, that means i miss you, but when i don’t text you, that means i am waiting for you to miss me.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 18,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Everybody knows how to love, but few people know how to stay in love with one person forever.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 19,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"No one will ever care like I did, I promise you that.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 20,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"We spend too much time looking for the perfect person to love instead of perfecting the love we give!\\n\",\n        \"saved\": \"N\",\n        \"sid\": 21,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Even if I had a million reasons to leave, I would still look for one to stay.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 22,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Every LOVE story is beautiful, but ours if my Favorite.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 23,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Every moment i spent with you is like a dream come true\\n\",\n        \"saved\": \"N\",\n        \"sid\": 24,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"You are the sunshine that starts my day.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 25,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I Just fell in love with you, I don’t know how, I don’t know why, I just did!\\n\",\n        \"saved\": \"N\",\n        \"sid\": 26,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Did YOU know i really love the second word of this question?\\n\",\n        \"saved\": \"N\",\n        \"sid\": 27,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"You can’t find love. Love is something that finds you.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 28,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Love was just a word before i met you.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 29,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Love is a game that two can play and both win.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 30,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I have decided to stick with love. Hate is too great a burden to handle.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 31,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Love cures us – both the ones who spread it and the ones who receive it.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 32,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Love is the honey and our life is a flower.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 36,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"People want to ride with you on a lambo, but you want someone who will ride you with on a auto when lambo breaks down.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 37,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"When the angels ask what I most loved about life, I'll say you.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 38,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Your cute smile is all I need to battle all struggles in my life.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 39,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I want to run away with you. Where there is only you and me.\",\n        \"saved\": \"N\",\n        \"sid\": 40,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Every love story is beautiful but ours is my favourite.\",\n        \"saved\": \"N\",\n        \"sid\": 41,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Dear crush!! You'ved crushed me 3\",\n        \"saved\": \"N\",\n        \"sid\": 42,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I want vitamin \\\"U\\\"\",\n        \"saved\": \"N\",\n        \"sid\": 43,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"You are the only clock thats ticking in my heart..!!\\n\",\n        \"saved\": \"N\",\n        \"sid\": 44,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Love is cute when it's new, but love is most beautiful when it lasts.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 45,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"My \\\"last seen at\\\" was just to check your \\\"last seen at\\\".\\n\",\n        \"saved\": \"N\",\n        \"sid\": 46,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Live life fully, no place for hate, only love.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 47,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Love is not about posssession, Love is about appreciation\\n\",\n        \"saved\": \"N\",\n        \"sid\": 48,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Life is too short to cry on....\\n\",\n        \"saved\": \"N\",\n        \"sid\": 49,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I love you no matter what you do, but do you have to do so much of it?\\n\",\n        \"saved\": \"N\",\n        \"sid\": 50,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Every time I look at the keyboard U and I always together.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 51,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Love doesn't make the world go round. Love is what makes the ride worthwhile.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 52,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I'd cross the world for someone like you.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 53,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Love cures people, both the one who give it and the one who receive it- Dr. Karl\\n\",\n        \"saved\": \"N\",\n        \"sid\": 54,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Hi, is a short, simple word but it's how love starts.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 55,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I usually don't get attached too easily, but that changes when I met you.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 56,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Anyone can catch your eye, but it takes someone special to catch your heart.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 57,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Can I borrow a Kiss? I promise I'll give it back.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 58,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"When I count my blessings i count you twice.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 59,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I need you so much closer.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 60,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"My heart is perfect because.. you are inside.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 61,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Love me for a second and I'll love you forever.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 62,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"You think you're one of millions but you're one in a million to me.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 63,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I want you today and tomorrow and next week and for the rest of my life.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 64,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"You know you’re in love when you see the world in her eyes and her eyes everywhere in the world.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 65,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Falling in love is only half of I want, staying in love with you for till forever is the other\\n\",\n        \"saved\": \"N\",\n        \"sid\": 66,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I want to run away with you. Where there is only you and me.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 67,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Every love story is beautiful but ours is my favorite.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 68,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I love you yesterday I love you still, I always have…. I always will\\n\",\n        \"saved\": \"N\",\n        \"sid\": 69,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Kiss me, and you may see stars, love me and I will give them to you.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 70,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Love is like a rubber band held at both ends by two people, when one leaves it hurts the other.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 71,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Thinking of you is easy, I do it every day. Missing you is the heartache that never goes away.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 72,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"This is going to sound crazy, but…from the moment I first set eyes on you I haven’t been able to stop thinking about you.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 73,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"If you ever ask me how many times you’ve crossed my mind, I would say once. Because you came, and never left.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 74,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Love is of all passions the strongest, for it attacks simultaneously the head, the heart and the senses.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 75,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Love is composed of a single soul inhabiting two bodies.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 76,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"A loving heart is the beginning of all knowledge.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 77,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"You have no idea how fast my heart beats when I see YOU!!\\n\",\n        \"saved\": \"N\",\n        \"sid\": 78,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Every time you texts me my cheeks hurt! I guess I smile too big.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 79,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Someone has stolen my heart and you are the highest on my list of suspects.\\n\",\n        \"saved\": \"N\",\n        \"sid\": 80,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"You’re the ping to my pong. \\n\",\n        \"saved\": \"N\",\n        \"sid\": 81,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Girls want to find a superman but walk past Clark Kent every day. \\n\",\n        \"saved\": \"N\",\n        \"sid\": 82,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"The best love is the kind that awakens the soul; that makes us reach for more, that plants the fire in our hearts and brings peace to our minds. That’s what I hope to give you forever.\",\n        \"saved\": \"N\",\n        \"sid\": 83,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I look at you and see the rest of my life in front of my eyes.\",\n        \"saved\": \"N\",\n        \"sid\": 84,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"All, everything that I understand, I only understand because I love.\",\n        \"saved\": \"N\",\n        \"sid\": 85,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"You are the source of my joy, the center of my world and the whole of my heart.\",\n        \"saved\": \"N\",\n        \"sid\": 86,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"When I tell you I love you, I am not saying it out of habit, I am reminding you that you are my life.\",\n        \"saved\": \"N\",\n        \"sid\": 87,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I don’t need paradise because I found you. I don’t need dreams because I already have you.\",\n        \"saved\": \"N\",\n        \"sid\": 88,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"You are the last thought in my mind before I drift off to sleep and the first thought when I wake up each morning.\",\n        \"saved\": \"N\",\n        \"sid\": 89,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Everywhere I look I am reminded of your love. You are my world.\",\n        \"saved\": \"N\",\n        \"sid\": 90,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Love is not about how many days, weeks or months you’ve been together, it’s all about how much you love each other every day.\",\n        \"saved\": \"N\",\n        \"sid\": 91,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"If I know what love is, it is because of you.\",\n        \"saved\": \"N\",\n        \"sid\": 92,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"You are my paradise and I would happily get stranded on you for a lifetime. \",\n        \"saved\": \"N\",\n        \"sid\": 93,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I can’t stop thinking about you, today… tomorrow… always.\",\n        \"saved\": \"N\",\n        \"sid\": 94,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"When I look into your eyes I see the mirror of my soul.\",\n        \"saved\": \"N\",\n        \"sid\": 95,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Thank you for always being my rainbow after the storm.\",\n        \"saved\": \"N\",\n        \"sid\": 96,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I am so totally, completely, overwhelmingly, eye-poppingly, life-changingly, spectacularly, passionately, deliciously in love with you.\",\n        \"saved\": \"N\",\n        \"sid\": 97,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"God is keeping me alive but you are keeping me in love.\",\n        \"saved\": \"N\",\n        \"sid\": 98,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"My angel, my life, my entire world, you’re the one that I want, the one that I need, let me be with you always, my love, my everything.\",\n        \"saved\": \"N\",\n        \"sid\": 99,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"This morning I awoke and was reminded of the preciousness of life. I realized I should express my gratitude to those who are so very important to me. Thank you for all you have done and have a great day!\",\n        \"saved\": \"N\",\n        \"sid\": 100,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I love you every step of the way. \",\n        \"saved\": \"N\",\n        \"sid\": 101,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Walk with me through life…and I’ll have everything I’ll need for the journey.\",\n        \"saved\": \"N\",\n        \"sid\": 102,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I may not be your first date, kiss or love…but I want to be your last everything.\",\n        \"saved\": \"N\",\n        \"sid\": 103,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"The best feeling is when you look at him…and he is already staring.\",\n        \"saved\": \"N\",\n        \"sid\": 104,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"And then my soul saw you and it kind of went, “Oh, there you are. I’ve been looking all over for you.\\\"\",\n        \"saved\": \"N\",\n        \"sid\": 105,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Together with you is my favorite place to be.\",\n        \"saved\": \"N\",\n        \"sid\": 106,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I am very indecisive and always have trouble picking my favorite anything. But, without a doubt, you are my favorite everything.\",\n        \"saved\": \"N\",\n        \"sid\": 107,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I still fall in love with you every day!\",\n        \"saved\": \"N\",\n        \"sid\": 108,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"The sun is up, the sky is blue, today is beautiful and so are you.\",\n        \"saved\": \"N\",\n        \"sid\": 109,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Thank you, my love, for always making me feel like the most beautiful woman in the world.\",\n        \"saved\": \"N\",\n        \"sid\": 110,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Thank God someone threw me away so you could pick me up and love me.\",\n        \"saved\": \"N\",\n        \"sid\": 111,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"If I had a flower for every time I thought of you, I could walk in my garden forever.\",\n        \"saved\": \"N\",\n        \"sid\": 112,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"It is because of you, my angel, that I now understand all of those quotes about love.\",\n        \"saved\": \"N\",\n        \"sid\": 113,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I’ve fallen in love many times…always with you.\",\n        \"saved\": \"N\",\n        \"sid\": 114,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I would rather feel your breath on the back of my neck than have all the riches in the world.\",\n        \"saved\": \"N\",\n        \"sid\": 115,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I still get butterflies every time I see you, even though I have seen you so many times before.\",\n        \"saved\": \"N\",\n        \"sid\": 116,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"There are only two times I want to be with you, now and forever.\",\n        \"saved\": \"N\",\n        \"sid\": 117,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Cuddling with you would be perfect right about now.\",\n        \"saved\": \"N\",\n        \"sid\": 118,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I’ll never ask you to change for me because you are perfect just the way you are.\",\n        \"saved\": \"N\",\n        \"sid\": 119,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I went to sleep last night with a smile because I knew I’d be dreaming of you… but I woke up this morning with a smile because you weren’t a dream. Good morning baby!\",\n        \"saved\": \"N\",\n        \"sid\": 120,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Follow your heart, it knows the way.\",\n        \"saved\": \"N\",\n        \"sid\": 121,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"When you come near me I get chills up my spine, goosebumps on my skin and all I can hear is the beating of my heart.\",\n        \"saved\": \"N\",\n        \"sid\": 122,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Yeah, I know he’s cute, but he’s mine. Touch him and I’ll kill you.\",\n        \"saved\": \"N\",\n        \"sid\": 123,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I would walk through the desert, I would walk down the aisle, I would swim all the oceans just to see you smile.\",\n        \"saved\": \"N\",\n        \"sid\": 124,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"As surely as the sun will rise tomorrow, so too will my heart beat only for you.\",\n        \"saved\": \"N\",\n        \"sid\": 125,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Thank you for going on this journey through life with me. There is nobody else who I would want by my side but you my angel.\",\n        \"saved\": \"N\",\n        \"sid\": 126,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"As you read these words, know that right at this moment, there is someone who is thinking about you and cares about you.\",\n        \"saved\": \"N\",\n        \"sid\": 127,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"If I did anything right in my life it was when I gave my heart to you.\",\n        \"saved\": \"N\",\n        \"sid\": 128,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"When I wake up in the middle of the night, I reach for you. When my hand finds your skin and I feel your touch my whole being relaxes and fills with joy. This is what I want to happen every night forever.\",\n        \"saved\": \"N\",\n        \"sid\": 129,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"A real man chooses to honor, love, adore, respect and be faithful to one woman only. I am glad you are my man.\",\n        \"saved\": \"N\",\n        \"sid\": 130,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"The moment when you roll over, put your arm around me and pull me close is the moment that makes my life complete.\",\n        \"saved\": \"N\",\n        \"sid\": 131,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"If I would choose between breathing and loving you, I would use my last breath to say, “I love you.\\\"\",\n        \"saved\": \"N\",\n        \"sid\": 132,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I love you for all that you are, all that you have been and all that you will be. \",\n        \"saved\": \"N\",\n        \"sid\": 133,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I'm much more me when I'm with you.\",\n        \"saved\": \"N\",\n        \"sid\": 134,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"No, he’s not perfect. He’s human and he’s flawed, but he’s perfect to me and that’s all that matters.\",\n        \"saved\": \"N\",\n        \"sid\": 135,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"We fight, we kiss, we hug, we text, we talk, we argue, we laugh, we smile, we love…that’s us.\",\n        \"saved\": \"N\",\n        \"sid\": 136,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Your face is to me like the rising sun, a promise of a new start, a hopeful future and the warming of my soul.\",\n        \"saved\": \"N\",\n        \"sid\": 137,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Every day I fall in love with you more and more. Well, not yesterday. Yesterday you were pretty annoying.\",\n        \"saved\": \"N\",\n        \"sid\": 138,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Every moment spent with you is like a beautiful dream come true. I love you!\",\n        \"saved\": \"N\",\n        \"sid\": 139,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Your beauty leaves me speechless.\",\n        \"saved\": \"N\",\n        \"sid\": 140,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"And when I open my eyes in the morning, I thirst for your touch.\",\n        \"saved\": \"N\",\n        \"sid\": 141,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"My heart is perfect because you are in it.\",\n        \"saved\": \"N\",\n        \"sid\": 142,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Forever is a long time, but I wouldn’t mind spending it by your side.\",\n        \"saved\": \"N\",\n        \"sid\": 143,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I want to show him what love really is, to make him feel love he’s never felt before, to make his heart beat in a way he never knew possible.\",\n        \"saved\": \"N\",\n        \"sid\": 144,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"You are my sunshine, my only sunshine, you make me happy when skies are grey, you’ll never know dear how much I love you, so please don’t take my sunshine away.\",\n        \"saved\": \"N\",\n        \"sid\": 145,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"You make me complete. Never before have I smiled so much. When life is difficult, I just call on you and you renew and refresh me. You inspire me, leave me in awe and give me a reason to live. I didn’t know what love meant until I met you.\",\n        \"saved\": \"N\",\n        \"sid\": 146,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"You are nothing short of my everything.\",\n        \"saved\": \"N\",\n        \"sid\": 147,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"You have found true love when you realize that you want to wake up beside your love every morning even when you have your differences.\",\n        \"saved\": \"N\",\n        \"sid\": 148,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Every morning is a joy because it is another chance to see your lovely smile, your penetrating eyes and your sweet lips. I cannot wait for this night to pass and to see you again in the morning.\",\n        \"saved\": \"N\",\n        \"sid\": 149,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"In this crazy world, full of change and chaos, there is one thing of which I am certain, one thing which does not change: my love for you.\",\n        \"saved\": \"N\",\n        \"sid\": 150,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"The best and most beautiful things in this world cannot be seen or even heard, but must be felt with the heart.\",\n        \"saved\": \"N\",\n        \"sid\": 151,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"To love is nothing. To be loved is something. But to love and be loved, that’s everything.\",\n        \"saved\": \"N\",\n        \"sid\": 152,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I saw that you were perfect, and so I loved you. Then I saw that you were not perfect and I loved you even more.\",\n        \"saved\": \"N\",\n        \"sid\": 153,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"In order to be happy oneself it is necessary to make at least one other person happy.\",\n        \"saved\": \"N\",\n        \"sid\": 154,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"The heart wants what it wants. There's no logic to these things. You meet someone and you fall in love and that's that.\",\n        \"saved\": \"N\",\n        \"sid\": 155,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"There's no substitute for a great love who says, 'No matter what's wrong with you, you're welcome at this table.'\",\n        \"saved\": \"N\",\n        \"sid\": 156,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I swear I couldn't love you more than I do right now, and yet I know I will tomorrow.\",\n        \"saved\": \"N\",\n        \"sid\": 157,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"You are the sun which gives me warmth, you are the air which gives me life, you are the blood which gives me vitality and you are my heart that beats your name.\",\n        \"saved\": \"N\",\n        \"sid\": 158,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Sometimes I wish there was no alarm clock because that is the only device which wakes me up while I am dreaming of you.\",\n        \"saved\": \"N\",\n        \"sid\": 159,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I will always protect you and take care of you. I will shelter you and be by your side always.\",\n        \"saved\": \"N\",\n        \"sid\": 160,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"Look at the brightly burning sun and you will know the extent to which my feelings burn for you.\",\n        \"saved\": \"N\",\n        \"sid\": 161,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"The best feeling in the world is to know that you are mine and I am yours. Every morning that is enough for me to have a good day.\",\n        \"saved\": \"N\",\n        \"sid\": 162,\n        \"submit\": \"admin\",\n        \"views\": 0\n    },\n    {\n        \"dislike\": null,\n        \"like\": null,\n        \"msg\": \"I could tell you that you complete me, but that would not be the truth, for each morning when I wake I long for you more than before.\",\n        \"saved\": \"N\",\n        \"sid\": 163,\n        \"submit\": \"admin\",\n        \"views\": 0\n    }\n]\n</script>",
